import "./topbar.css"

function isUser(user) {
    if (user && user.username) return user.username;
    return "Login";
  }

const TopBar = (props) => {
    return (
      <div className="topbar">
        <div className="topbar-content">
          <div className="topbar-sites">
              Home | Other | Another
          </div>
          <div className="topbar-login">
            {isUser(props.user)}
          </div>
        </div>
      </div>
    );
  };

export default TopBar;
